import './App.css';
import { useState } from 'react';
import Axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';



function App() {

const [nombre,setNombre] = useState("");
const [edad,setEdad] = useState(0);
const [pais,setPais] = useState("");
const [cargo,setCargo] = useState("");
const [anios,setAnios] = useState(0);

const [perfumeList,setPerfumes] = useState([]);

const add = () =>{
  Axios.post("http://localhost:3001/create", {
    nombre:nombre,
    edad:edad,
    pais:pais,
    cargo:cargo,
    anios:anios
  }).then(()=>{

    alert("perfume registrado");
  });
}

useEffect(() => {
  async function fetchData() {
    const getPerfumes = () =>{
      Axios.get("http://localhost:3001/perfumes").then((response)=>{
         setPerfumes(response.data);
      });
    }

    const json = await response.json();
    updateData(json);
  }
  fetchData();
}, []);

getPerfumes();
// const getPerfumes = () =>{
//   Axios.get("http://localhost:3001/perfumes").then((response)=>{
//      setPerfumes(response.data);
//   });

// }




  return (
    <div className="container">

    <div className="card text-center">
        <div className="card-header">
          GESTION DE PERFUMES
        </div>
        <div className="card-body">
            <div className="input-group mb-3">
              <span className="input-group-text" id="basic-addon1">Nombre:</span>
              <input type="text" 
              onChange={(event)=>{
                setNombre(event.target.value);
              }}
              className="form-control" placeholder="" aria-label="Edad" aria-describedby="basic-addon1" />
              </div>
            <div className="input-group mb-3">
              <span className="input-group-text" id="basic-addon2">Edad:</span>
              <input type="number" 
              onChange={(event)=>{
                setEdad(event.target.value);
              }}
              className="form-control" placeholder="" aria-label="Pais" aria-describedby="basic-addon1" />
            </div>  
            <div className="input-group mb-3">
              <span className="input-group-text" id="basic-addon2">Pais:</span>
              <input type="text" 
              onChange={(event)=>{
                setPais(event.target.value);
              }}
              className="form-control" placeholder="" aria-label="Cargo" aria-describedby="basic-addon1" />
            </div>  
            <div className="input-group mb-3">
              <span className="input-group-text" id="basic-addon2">Cargo:</span>
              <input type="text" 
             onChange={(event)=>{
              setCargo(event.target.value);
            }}
              className="form-control" placeholder="" aria-label="Anios" aria-describedby="basic-addon1" />
            </div>  
            <div className="input-group mb-3">
              <span className="input-group-text" id="basic-addon2">Experiencia:</span>
              <input type="number" 
             onChange={(event)=>{
              setAnios(event.target.value);
            }}
              className="form-control" placeholder="" aria-label="Username" aria-describedby="basic-addon1" />
            </div>  






        </div>
        <div className="card-footer text-muted">
        <button className='btn btn-primary' onClick={add}>Registrar</button>


        </div>
    </div>

        <table className="table table-striped">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Nombre</th>
                <th scope="col">Edad</th>
                <th scope="col">Pais</th>
                <th scope="col">Cargo</th>
                <th scope="col">Experiencia</th>
              </tr>
            </thead>
            <tbody>

            {

         perfumeList.map((val,key)=>{
           return  <tr key={val.id}>
                      <th scope="row">{val.id}</th>
                      <td>{val.nombre}</td>
                      <td>{val.edad}</td>
                      <td>{val.pais}</td>
                      <td>{val.cargo}</td>
                      <td>{val.anios}</td>

                   </tr>
          })
         }

            </tbody>

        </table>
    </div>
  );
}

export default App;
